import React from 'react';
import { Fab } from '@mui/material';
import AddIcon from '@mui/icons-material/Add';
import TableComp from '../../components/DataTable';

const fabStyle = {
    margin: 0,
    top: 'auto',
    right: 'auto',
    bottom: 20,
    left: 20,
    position: 'fixed',
};

function Systems(props) {
    return (
        <div>
            <TableComp/>
            <Fab style={fabStyle} title='הוסף מערכת' color='#38cc9c'>
                <AddIcon/>
            </Fab>
        </div>
    );
}

export default Systems;
